func TestGetCfbm(t *testing.T) {
	unflag := ".ExCw1hM0VTDFvHH62tfDRTytY.07gDeQuHC5cePNXw-1686700548-0-Ab2+H741TSxTG06/+CiCF8o+0ZtypFoIsWRlohlSA5/i5reVvjgYi38+eYrW7ev5ng=="

	brFp, err := fpclient.LoadFingerprint(&fpclient.LoadingConfig{
		FilePath: "../assets/fingerprints/chrome.json",
	})

	if err != nil {
		panic(err)
	}

	type args struct {
		brFp  *fpclient.Fingerprint
		proxy string
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		// TODO: Add test cases.
		{
			args: args{
				brFp:  brFp,
				proxy: "http://cap1217:gLAty@172.252.8.224:61234",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			for i := 0; i < 5; i++ {
				got, err := cloudflarereverse.GetCfbm(tt.args.brFp, tt.args.proxy)
				if (err != nil) != tt.wantErr {
					t.Errorf("GetCfbm() error = %v, wantErr %v", err, tt.wantErr)
					return
				}

				fmt.Printf("[ðŸ”‘] Cookie: %s\n", got)

				if len(got) != len(unflag) {
					t.Errorf("GetCfbm() error = %v, len = %d, wantlen = %d", fmt.Errorf("cookie lenght bad"), len(got), len(unflag))
					return
				}

				fmt.Println("[âœ…] Unflag")
			}
		})
	}
}

