func Test_formatFingerprint(t *testing.T) {
	brFp, err := fpclient.LoadFingerprint(&fpclient.LoadingConfig{
		FilePath: "../assets/fingerprints/win10.json",
	})

	if err != nil {
		panic(err)
	}

	type args struct {
		fp *fpclient.Fingerprint
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		// TODO: Add test cases.
		{
			name: "test-format-fingerprint",
			args: args{
				fp: brFp,
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			res := cloudflarereverse.FormatFingerprint(tt.args.fp)
			fmt.Println(res)
		})
	}
}
